css:
@-moz-document domain('tumblr.com'), url-prefix('http://www.tumblr.com/') , url-prefix("https://www.tumblr.com/") {



#dashboard_index{background: url('http://farm6.static.flickr.com/5150/5598630155_c958dd75d0_b.jpg') repeat 100% 0% !important;}



#left_column, #right_column {background-color: transparent !important;}

div.l-content.l-content.l-content {background-color:#FF3366!important;}



ol#posts li.notification{background-color: #FF3366 !important;

border-bottom: 1px solid #FF0066 !important;

color: #A8BCCB !important;}



#left_column .dashboard_options_form {

   background: url('http://assets.tumblr.com/images/white_20.png')#FF3366;

}



#right_column a#dashboard_switch_blog_menu_current:hover {

   background: transparent;

}



#nav .nav_item.active{

   background-color:#E72678
  
   

}



#left_column #posts .post .permalink{

   background-color:#FF0066;

}



#nav .nav_item.active, #nav .nav_item .nav_menu, #nav .nav_item .nav_item_nipple .nav_item_nipple_pixel{

   background-color:#E72678;

}



}
